import React from 'react';
import {useSelector,useDispatch} from 'react-redux';
import {withRouter} from 'react-router-dom';
import WriteSchedule from '../../component/write/WriteSchedule';

import {register} from '../../modules/write';




const WriteContainer=({history})=>{

     const dispatch = useDispatch();

     const {write}=useSelector(({write})=>({

        write:write.write,
        
     }))

     const onFinal=({imp,classname,classtime,profess,classscore})=>{

        let type;

        if(imp==='1')
            type='type1';
        else if(imp==='2')
            type='type2';
        else if(imp==='3')
            type='type3';

        
        dispatch(
            register({
                form:type,
                value:{
                  classname,
                  classtime,
                  profess,
                  classscore,
                 }
                
            })
        );
        
    
    };


     return (

        <WriteSchedule 
        
        onFinal={onFinal}

        />

     );

};
